import React from "react";
import CardHorizontal from "../../components/websiteMobile/card/cardHorizontal/CardHorizontal";
import "./Cart.css";

const Cart = ()=>{
    return(
        <div className="cartContainer">
            <div className="cartTitle">
                <h1>Shopping cart</h1>
            </div>
            <div className="cartCardHoriontal">
                <CardHorizontal/>
            </div>
        </div>
    )
}

export default Cart;
